import React from 'react';
import GlobeIcon from 'mdi-react/GlobeIcon';
import EyeIcon from 'mdi-react/EyeIcon';
import "./footer.css";
//import EyeIcon from 'mdi-react/EyeIcon';
//import EyeIcon from 'mdi-react/EyeIcon';

export default function Footer() {
  return(
   
  <footer className="v-footer" data-booted="true">
    <span small="" style={{"margin-left": "80px"}}>Icons by 
     <a href="https://icons8.com/">Icons8</a>
      </span>
  
        <div className="spacer"></div>
       
      <div style={{"margin-right": "20px"}}>
    <a href="https://croppaco.com/" target="_blank" className="mr-1 v-btn v-btn--icon v-btn--round theme--light v-size--small">
      <span className="v-btn__content"><GlobeIcon className="some-class" size={16} /></span>//</a>
      
     <a href="https://facebook.com/croppaco" target="_blank" className="mr-1 v-btn v-btn--icon v-btn--round theme--light v-size--small"><span className="v-btn__content"><i aria-hidden="true" className="v-icon notranslate mdi mdi-facebook theme--light"></i></span></a>
      
      <a href="https://twitter.com/croppaco" target="_blank" className="mr-1 v-btn v-btn--icon v-btn--round theme--light v-size--small"><span className="v-btn__content"><i aria-hidden="true" className="v-icon notranslate mdi mdi-twitter theme--light"></i></span></a>
      
      <a href="https://www.youtube.com/channel/UCg-Pu877VEhoS9As-SOC3rw" target="_blank" className="mr-1 v-btn v-btn--icon v-btn--round theme--light v-size--small"><span className="v-btn__content"><i aria-hidden="true" className="v-icon notranslate mdi mdi-youtube theme--light"></i></span></a>*/
      
      <span style={{"margin-left": "10px", "color": "rgb(79, 79, 79)"}}> Â© 2021 <strong>CroppaCo</strong></span>
    </div>
     
   </footer>
     
      );
}
